import React from 'react';

const ToggleSwitch = ({label, isToggled, onToggle}) => {
  return (
    <label className="toggle">
      <input  type="checkbox"
              checked={isToggled}
              onChange={onToggle}/>
      <span className="toggle-slider"/>
    </label>
  );
};

export default ToggleSwitch;
